import React from 'react';
import BookList from './componenets/bookList';

import CreateProductForm from './components/CreateProductForm'
import NavBar from "./components/NavBar";
import ProductList from "./components/ProductList";
import Products from "./components/Products";
import { ProductListProvider } from "./context/ProductContext";
import ProductDetail from "./components/ProductDetail";
import UpdateProductForm from './components/UpdateProductForm';
import Books from './componenets/Books';
import { BookListProvider } from './context/BookContext';

function App() {
  return (
    <Router>
      <BookListProvider>
        <div className="container">
          <NavBar />
          <hr />
          <Routes>
            <Route path="/" element={<Books />}>
              <Route index element={<BookList />} />
              {/*<Route path=":id" element={<ProductDetail />} />
              <Route path=":id/edit" element={<UpdateProductForm />} />*/}
            </Route>
          </Routes>
        </div>
      </BookListProvider>
    </Router>
  );
}

export default App;
